// src/components/LoginYouTube.js
import React from 'react';

const LoginYouTube = () => {
  const loginToYouTube = () => {
    const BASE_URL = 'http://localhost:3001'; // Adjust as needed
    window.location.href = `${BASE_URL}/youtube/login`; // Redirect to your backend's YouTube login route
  };

  return (
    <div>
      <h2>Login to YouTube Music</h2>
      <button onClick={loginToYouTube}>Login</button>
    </div>
  );
};

export default LoginYouTube;
